const PlayCoPlaylistDetail = (props) => {
  return <section className='playCoPlaylistDetail' {...props}>
    <header>
      <h2>PlayCO</h2>
      <p>{'플레이리스트 이름'}</p>
    </header>
  </section>;
};

export { PlayCoPlaylistDetail };
